import React from "react";
import logo from "./logo.svg";
import "./App.css";

function App() {
  return (
    <div className="App">
      <form>
        <h1>Hello Sandeep </h1>
        <label>User Name</label>
        <input type="text" placeholder="Username" />
        <label>Password</label>
        <input type="password" placeholder="Password" min="2" required />
        <button
          onClick={() => {
            alert("Nice");
          }}
        >
          Submit
        </button>
      </form>
    </div>
  );
}

export default App;
